"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[677],{1405:(e,t,o)=>{o.d(t,{A:()=>i});let i={src:"/_next/static/media/logo.45123f70.svg",height:59,width:59,blurWidth:0,blurHeight:0}},3540:(e,t,o)=>{o.d(t,{Ix:()=>m,L5:()=>n,Sn:()=>a,Z1:()=>d,gD:()=>i,gp:()=>s,i$:()=>r,oK:()=>l,tc:()=>c,vw:()=>p,xL:()=>h});let i="https://t.me/sharinteriors",a="https://vk.com/sharinteriors",n="https://wa.me/79777066700",r="https://www.instagram.com/shar_interiors",s="+79777066700",h="+7 977 706 6700",c="sharinteriors@gmail.com",l="service_eiz8vwk",d="template_voq0rko",m="-6YbOldzqGjRABjV2",p="sharinteriors@gmail.com"},6327:(e,t,o)=>{var i,a=o(7985),n=o(1218);let r=JSON.parse('{"home":"home","about":"about","projects":"projects","contacts":"contacts","private":"private","public":"public","Coming soon":"coming soon","home subtitle":"Stylish interiors of any complexity","Moscow":"Moscow","Yekaterinburg":"Yekaterinburg","Tbilisi":"Tbilisi","Saint-Petersburg":"Saint-Petersburg","Wrocław":"Wrocław","about-logo-1":"Style is the basis.","about-logo-2":"Eclecticism is a trend.","about-logo-3":"A vibrant life is a guide.","about-name":"Alexander Sharkov","about-founder":"Founder of the studio","about-first-p":"SHAR Design studio creates and implements stylish interiors of any complexity.","about-second-p":"We design apartments, houses and public spaces.","about-third-p":"Our design is a skillful combination of minimalism with high-tech through the prism of eclecticism especially for you.","Fusion in Zamoskvorechye":"Fusion in Zamoskvorechye","White apartaments":"White apartaments","Georgian character":"Georgian character","Monochrome minimalism":"Monochrome minimalism","Vintage Coffee Shop":"Vintage Coffee Shop","High-tech office":"High-tech office","Apartament in the center of Europe":"Apartament in the center of Europe","Contemporary comfort":"Contemporary comfort","fusion-decription-text":" The interior design was inspired by the house and the atmosphere of the area where the apartment is located. Stalin\'s house with high ceilings in the historic center of Moscow. White walls like canvas were painted with bright spots of decor from the past. The steel kitchen, as a reflection of the rhythm of modern Moscow, coexists with the objects of the Soviet era.","monochrome-description-1":"The modern house in the suburbs is made on black and white nuances. The kitchen-living room is contrastingly divided: a dark kitchen area and a light lounge area.  The sofa is upholstered in a contrasting fabric, which further distinguishes this part of the space and sets the tone for the entire room.","monochrome-description-2":"The bedrooms and bathroom are also made on the contrast of black and white.  A variety of light sources and lighting scenarios, do not make the dark spaces seem gloomy.","hightech-description":"The office of an innovative company producing freezing equipment is a unique workspace. Hidden lighting, a luminous ceiling and aluminum used in the project reveal the idea of making a \\"space shuttle\\" out of the office and emphasize the company\'s manufacturability.","white-decription-text":"Project of a cozy apartment for a young family in Yekaterinburg. In addition to the design, the task was to make a competent layout. It was necessary to create an additional bedroom and preserve the spaciousness of the kitchen-living room.","white-extra-text-1":"The interior, inspired by the aesthetics of Japanese houses, is designed in a calm natural range. The main color of the walls is white, which makes the apartment visually more spacious. In support of him, gray-beige, on the walls in the hallway and kitchen. The furniture made of light wood veneer emphasizes the environmental friendliness of the interior and its proximity to nature.","white-extra-text-2":"The entrance to the bedroom is through an opening with a sliding high door that divides the spaces. Also, the bedroom is separated from the living room by a wall of glass blocks. This way we do not lose the light from the window, but at the same time we barely see what is happening in the bedroom. The bathroom decoration is in perfect harmony with the rest of the apartment. Porcelain stoneware of a neutral shade, but with texture makes the space concise.","loft-decription-text":"Project of a cozy apartment for a young family in Yekaterinburg. In addition to the design, the task was to make a competent layout. It was necessary to create an additional bedroom and preserve the spaciousness of the kitchen-living room.","loft-decription-text-2":"The interior, inspired by the aesthetics of Japanese houses, is designed in a calm natural range. The main color of the walls is white, which makes the apartment visually more spacious. In support of him, gray-beige, on the walls in the hallway and kitchen. The furniture made of light wood veneer emphasizes the environmental friendliness of the interior and its proximity to nature.","loft-decription-text-3":"The entrance to the bedroom is through an opening with a sliding high door that divides the spaces. Also, the bedroom is separated from the living room by a wall of glass blocks. This way we do not lose the light from the window, but at the same time we barely see what is happening in the bedroom. The bathroom decoration is in perfect harmony with the rest of the apartment. Porcelain stoneware of a neutral shade, but with texture makes the space concise.","georgia-description-text":"View apartment for a young man in Tbilisi. The windows of the apartment offer picturesque views of the cityscape and nature. They are reflected in the materials and colors of the interior.","georgia-description-text-extra":"A rich palette of natural colors and textures adds sophistication, from the dominant beige and olive base of the walls to bright terracotta tones and black parquet. The natural upholstery materials of the upholstered furniture are in harmony with the bright metal panels in the bedroom and the countertop of the kitchen island.","georgia-description-text-2":"The choice of furniture, fittings, finishes and designer products — each element contributes to the visual journey around the country. So the mirrored coffee table looks like the modern architecture of the city, and the concrete ceiling refers us to the architecture of Soviet Georgia. The soft glow of floor lamps and lamps creates comfort and sends us even more to the evening streets of Tbilisi.","georgia-description-text-2-extra":"The apartment has an open plan: the kitchen-dining room is combined with the living room in a common space. Separately, there is a bedroom with a dressing room, which can be accessed through a glass partition.","coffee-description-text":"A coffee shop in St. Petersburg, designed using materials and colors in the spirit of American establishments of the prohibition era.","coffee-description-text-extra":"In the languid interior, the rounded shape of Art Deco contract with metal, and noble wall decoration with tinted oak panels, makes the interior warmer and conveys the atmosphere of old America of the XX century. Thanks to this, the interior becomes a cozy place both for reflection with a cup of coffee and for friendly gatherings in a pleasant company.","coffee-description-text-2":"The plaid tile floor creates a bright accent that blends in with the rest of the retro objects and furniture. The bar is the center of the establishment, it is decorated with lights and signs with menus in the spirit of New York nightlife. Vintage chandeliers above the round tables perfectly complement the style of the establishment.","poland-head-text-1":"A stylish apartment for a young couple, nestled in the heart of Poland’s Wroclaw. Its interior draws inspiration from 1970s aesthetics, with designers embracing bold, unconventional choices.","poland-desc-text-1":"In the living room, a soft green sofa stands out against a neutral backdrop. It’s paired with a modernist metal kitchen featuring a bright orange tile and wooden cabinets. The space gains character from exposed wiring and bold red metal chairs, while the wooden flooring adds a touch of warmth.","poland-desc-text-2":"A rich terracotta hue in the hallway and bedroom complements an old brick arch, infusing the interior with coziness and charm.","poland-desc-text-3":"The timeless yet inviting atmosphere is achieved through a mix of textures and clean lines. Designed to resist fleeting trends, the space remains fresh and relevant across eras.","poland-desc-text-4":"Warm natural materials and muted tones blend seamlessly with vibrant color accents and nods to 20th-century classic design. Radiating warmth and personality, this apartment is crafted not just for everyday comfort but also for aesthetic delight. It’s a harmonious reflection of its owners’ lifestyle—a space that feels both intentional and alive.","comfort-1":"A weekend apartment is the perfect solution for a relaxing getaway with friends or hosting guests. This very idea inspired the interior design.","comfort-2":"We crafted the space in a refined yet accessible style-minimalist, yet full of character. The sleek, contemporary design fills the apartment with warmth, while green accents enhance the harmonious color scheme, creating a visual connection between rooms. Black elements add contrast, balancing the light palette with bold details that deepen the appreciation of the interior’s cohesion.","comfort-3":"The palette revolves around natural, timeless materials that bring warmth and tranquility. The noble oak flooring plays a key role, offering both visual and tactile comfort.","comfort-4":"The kitchen, dining area, and living room merge into a single open space at the heart of the apartment.","comfort-5":"The primary bedroom includes a walk-in closet and a private bathroom. The bathroom is styled in earthy tones with soft lighting, evoking a cozy and soothing ambiance.","comfort-6":"The guest bathroom features a contrasting scheme: light plastered walls paired with bold black accents.","comfort-7":"This space is harmonious, functional, and stylish—every detail is thoughtfully curated and serves a purpose.","contacts-inst":"instagram","popup-name":"name","popup-tel":"phone","popup-comm":"comment","popup-send":"send","popup-sending":"sending...","contact-us":"contact us","form-field-name":"your name","form-field-email":"example@site.com (optional)","form-field-comment":"your comment (optional)","form-success":"Form was successfully sent","form-error":"Fill in the required fields to submit the form","server-error":"Sorry, we can\'t submit your form yet. Try later.","terms":"Terms and conditions","404-msg":"oops, the page you are looking doesn’t exist","404-anchor":"go back to main"}'),s=JSON.parse('{"home":"главная","about":"о нас","projects":"проекты","contacts":"контакты","private":"частные","public":"общественные","Coming soon":"вскоре","home subtitle":"Стильные интерьеры любой сложности","Moscow":"Москва","Yekaterinburg":"Екатеринбург","Tbilisi":"Тбилиси","Saint-Petersburg":"Санкт-Петербург","Wrocław":"Вроцлав","about-logo-1":"Стиль — основа.","about-logo-2":"Эклектика — тренд.","about-logo-3":"Яркая жизнь — ориентир.","about-name":"Александр Шарков","about-founder":"Основатель студии","about-first-p":"Студия SHAR Design создает и реализует стильные интерьеры любой сложности.","about-second-p":"Мы проектируем квартиры, дома и общественные помещения.","about-third-p":" Наш дизайн – это умелое сочетание минимализма с хай-теком сквозь призму эклектики специально для вас.","Fusion in Zamoskvorechye":"Фьюжн в Замоскворечье","fusion-decription-text":"Дизайн интерьера был навеян домом и атмосферой района, где находится квартира. Сталинский дом с высокими потолками в историческом центре Москвы. Белые стены гостиной, как холст были раскрашены яркими пятнами- декором из прошлого. А стальная кухня, как отражение ритма современной Москвы. Спальня и санузел выполнены в уютном горчичном цвете, а разнообразие материалов только подчеркивает самобытность этой квартиры.","Monochrome minimalism":"Монохромный минимализм","monochrome-description-1":"Современный дом в Подмосковье выполнен на черно-белых нюансах. Кухня-гостиная контрастно поделана: темная зона кухни и светлая лаундж-зона. Диван обтянут контрастной тканью, что дополнительно выделяет эту часть пространства и задает тон всей комнате. ","monochrome-description-2":"Спальни и санузел тоже сделаны на контрасте черного и белого. Разнообразие источников света и сценариев освещения, не дают темным пространствам казаться мрачными.","High-tech office":"Хай-тек офис","hightech-description":"Офис инновационной компании, производящей морозильное оборудование – это уникальное  рабочее пространство.  Использованные в проекте скрытая подсветка, светящийся потолок и аллюминий раскрывают идею, сделать из офиса \xabкосмический шаттл\xbb и подчеркивают технологичность компании. ","White apartaments":"Светлые апартаменты","white-decription-text":"Проект уютной квартиры для молодой семьи в Екатеринбурге. Помимо дизайна задача состояла в том, чтобы сделать грамотную планировку – создать дополнительную спальню и сохранить простор кухни-гостиной.","white-extra-text-1":"Вдохновленный эстетикой японских домов, интерьер выдержан в спокойной природной гамме. Получился лаконичный минимализм. Основной цвет стен – белый, делает квартиру визуально просторнее. В поддержку ему серо-бежевый, на стенах в прихожей и кухне. Мебель из шпона светлого дерева подчеркивает экологичность интерьера и его близость с природой.","white-extra-text-2":"Вход в спальню через проём со сдвижной высокой дверью, которая разделяет пространства. Также спальню от гостиной отделяет стена из стеклоблоков. Тем самым мы не теряем свет из окна, но при этом слабо видим происходящее в спальне. Отделка ванной комнаты отлично гармонирует с остальными помещениями квартиры. Керамогранит нейтрального оттенка, но с фактурой делает пространство лаконичным.","loft-decription-text":"Проект уютной квартиры для молодой семьи в Екатеринбурге. Помимо дизайна стояла задача сделать грамотную планировку. Необходимо было создать дополнительную спальню и сохранить простор кухни-гостиной.","loft-decription-text-2":"Интерьер, вдохновленный эстетикой японских домов, выдержан в спокойной природной гамме. Основной цвет стен – белый, что делает квартиру визуально просторнее. В его поддержку серо-бежевый цвет на стенах в коридоре и на кухне. Мебель из шпона светлого дерева подчеркивает экологичность интерьера и его близость к природе.","loft-decription-text-3":"Вход в спальню осуществляется через проем с высокой раздвижной дверью, разделяющей пространство. Также спальня отделена от гостиной стеной из стеклоблоков. Таким образом мы не теряем свет из окна, но при этом почти не видим, что происходит в спальне. Отделка ванной комнаты идеально гармонирует с остальной частью квартиры. Керамогранит нейтрального оттенка, но с фактурой делает пространство лаконичным.","Georgian character":"Грузинский характер","georgia-description-text":"Видовая квартира для молодого человека в Тбилиси. Из окон квартиры открываются живописные виды на городской пейзаж и природу. Своё отражение они нашли в материалах и цветовой гамме интерьера. ","georgia-description-text-extra":"Добавляет изысканности богатая палитра природных цветов и текстур — от доминирующей бежево-оливковой основы стен до ярких терракотовых тонов и черного паркета. Натуральные материалы обивки мягкой мебели гармонируют с яркими панелями из металла в спальне и столешницы кухонного острова. ","georgia-description-text-2":"Выбор мебели, фурнитуры, отделки и дизайнерских изделий — каждый элемент вносит свой вклад в визуальное путешествие по стране. Так зеркальный кофейный столик похож на современную архитектуру города, а бетонный потолок отсылает нас к архитектуре советской Грузии. Мягкое свечение торшеров и ламп, создает уют и еще больше отсылает нас к вечерним улочкам Тбилиси.","Vintage Coffee Shop":"Винтажная кофейня","georgia-description-text-2-extra":"Квартира имеет открытую планировку: кухня-столовая совмещена с гостиной в общее пространство. Отдельно располагается спальня с гардеробной, куда можно попасть через стеклянную перегородку.","coffee-description-text":"Кофейня в Санкт-Петербурге, оформленная с использованием материалов и цветов в духе американских заведений эпохи сухого закона.","coffee-description-text-extra":"В томном интерьере округлые формы ар-деко контрастируют с металлом, а благородная отделка стен тонированными дубовыми панелями, делает интерьер теплее и передает атмосферу старой Америки XX века. Благодаря чему интерьер становится уютным местом как для размышлений с чашечкой кофе, так и для дружных посиделок в приятной компании. ","coffee-description-text-2":"Пол из клетчатой плитки, создает яркий акцент, сочетающееся с остальными ретро предметами и мебелью. Бар является центром заведения, он украшен огнями и вывесками с меню в духе ночных заведений Нью-Йорка. Винтажные люстры над круглыми столиками идеально дополняют стилистику заведения.","Apartament in the center of Europe":"Квартира в центре Европы","poland-head-text-1":"Квартира, для молодой пары, расположенная в самом сердце польского города Вроцлав. Ее интерьер вдохновлен эстетикой 1970-х годов, а дизайнеры не побоялись смелых решений.","poland-desc-text-1":"В гостиной на нейтральном фоне выделяется мягкий диван зеленого оттенка. Его дополняет модернистская металлическая кухня с ярко-оранжевым фартуком и деревянными шкафами. Особый колорит пространству придают открытая проводка и металлические красные стулья, а уютную атмосферу подчеркивает деревянный пол.","poland-desc-text-2":"Яркий терракотовый цвет в коридоре и спальне гармонирует со старой кирпичной аркой, добавляя интерьеру тепла и характера.","poland-desc-text-3":"Вневременная атмосфера и уютная обстановка создаются за счет сочетания разных фактур и лаконичных форм. Пространство спроектировано так, чтобы избежать влияния быстротечных трендов — оно остается актуальным и свежим в любую эпоху.","poland-desc-text-4":"Квартира излучает тепло и индивидуальность: она продумана не только для повседневного комфорта, но и для эстетического наслаждения. Это гармоничное пространство, которое отражает образ жизни своих владельцев. В оформлении использованы теплые натуральные материалы и приглушенные оттенки, которые сочетаются с яркими цветовыми акцентами и отсылками к классическому дизайну XX века.","Contemporary comfort":"Современный комфорт","comfort-1":"Квартира выходного дня — идеальное решение для приятного отдыха с друзьями или приема гостей. Именно с этой идеей был создан дизайн интерьера.","comfort-2":"Мы оформили интерьер в изысканном, но доступном стиле - минималистичном, но с характером. Лаконичный современный дизайн наполняет квартиру уютом, а зеленые акценты подчеркивают гармоничную цветовую гамму, создавая визуальную связь между комнатами. Черные элементы добавляют контраст, разбавляя светлую палитру выразительными деталями, что помогает глубже прочувствовать интерьер и оценить его целостность.","comfort-3":"В основе палитры - натуральные и вневременные материалы, которые привносят тепло и спокойствие. Благородный дубовый пол играет ключевую роль, обеспечивая визуальный и тактильный комфорт.","comfort-4":"Кухня, столовая и гостиная объединены в единое пространство в центре квартиры.","comfort-5":"Главная спальня включает гардеробную и собственную ванную комнату. Ванная оформлена в природных тонах с мягким освещением, что создает уютную и расслабляющую атмосферу.","comfort-6":"Гостевой санузел выполнен в контрастной гамме: светлые стены со штукатуркой дополнены чёрными акцентами.","comfort-7":"Данное пространство - гармоничное, функциональное и стильное, где каждая деталь продумана и несет свою смысловую нагрузку.","contacts-inst":"instagram","popup-name":"имя","popup-tel":"телефон","popup-comm":"комментарий","popup-send":"отправить","popup-sending":"отправляем...","contact-us":"связаться","form-field-name":"ваше имя","form-field-email":"example@site.com (не обязательно)","form-field-comment":"ваш комментарий (не обязательно)","form-success":"Форма была успешно отправлена","form-error":"Заполните обязательные поля для отправки формы","server-error":"Извините, мы пока не можем отправить вашу форму. Попробуйте позже.","terms":"Политика конфиденциальности","404-msg":"ой, страница не найдена","404-anchor":"вернуться на главную","Sharinterior | Projects":"Sharinterior | Проекты","Sharinterior | About":"Sharinterior | О нас","Sharinterior | Contacts":"Sharinterior | Контакты","Sharinterior | Private projects":"Sharinterior | Частные проекты","Sharinterior | Public projects":"Sharinterior | Общественные проекты"}');if(a.Ay.use(n.r9).init({resources:{en:{translation:r},ru:{translation:s}},lng:"en",fallbackLng:"en",interpolation:{escapeValue:!1}}),"undefined"!=typeof document){let e=null==(i=document.cookie.split("; ").find(e=>e.startsWith("language=")))?void 0:i.split("=")[1];e&&("en"===e||"ru"===e)?a.Ay.changeLanguage(e):document.cookie="language=en; path=/; max-age=31536000"}},7748:(e,t,o)=>{o.d(t,{A:()=>s});var i=o(5155),a=o(6874),n=o.n(a),r=o(5695);function s(e){let{href:t,onClick:o,basicClassName:a,children:s}=e,h=(0,r.usePathname)()===t,c="";return a&&(c=a,h&&(c+=" active")),(0,i.jsx)(n(),{onClick:o,href:t,className:c,children:s})}},8977:(e,t,o)=>{o.d(t,{A:()=>n});var i=o(5155),a=o(1218);o(6327);let n=function(){let{i18n:e}=(0,a.Bd)();return(0,i.jsx)("button",{id:"lng-swt",className:"header-btn header-btn-mobile lng-switcher",onClick:()=>{let t="ru"===e.language?"en":"ru";e.changeLanguage(t),document.cookie="language=".concat(t,"; path=/; max-age=31536000")},children:"ru"===e.language?"en":"ru"})}}}]);